  true,\n\t\"url\": null,\n\t\"notes\": \"Real Estate Across the United States (REXUS)
  is the primary tool used by PBS to track and manage the government's real property
  assets and to store inventory data, building data, customer data, and lease information.
  STAR manages aspects of real property space management, including identification
  of all building space and daily management of 22,000 assignments for all property
  to its client Federal agencies. This data set contains PBS building inventory that
  consists of both owned and leased buildings with active and excess status.\",\n\t\"license_title\":
